import {
  Box,
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";
import React from "react";

const Artist = () => {
  return (
    <Card sx={{ maxWidth: 345 }} sx={{ m: "auto" }}>
      <Typography gutterBottom variant="h5" component="div">
        {/* {currChannel.name} */}
      </Typography>

      <CardMedia
        component="img"
        height="200"
        // image={
        //   require(`../../../../resources/promoters/youtube/${currChannel.profileImage}`)
        //     .default
        // }
        alt="green iguana"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          {/* {currChannel.orginalName} */}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          {/* {currChannel.orginalName} */}
        </Typography>
      </CardContent>
      <CardActions style={{ background: "black" }}>
        <Box
          sx={{
            display: "flex",
            justifyContent: "space-evenly",
            width: "100%",
          }}
        >
          //add buttob to open single page
        </Box>
        {/* <SocialLinks linksData={currChannel.sociallinks} /> */}
      </CardActions>
    </Card>
  );
};

export default Artist;
